import { Button, TextField } from "@material-ui/core";
import React from "react";
export default function CustomButton(
  type,
  onClick,
  variant,
  color,
  size,
  text,
  ...others
) {
  return (
    <Button
      type={type || "submit"}
      {...others}
      onClick={onClick}
      variant={variant || "contained"}
      color={color || "primary"}
      size={size || "large"}
      {...others}
      fullWidth
    >
      {text}
    </Button>
  );
}
